import { useState } from "react"

export default function Header() {
    const [now,setNow] = useState(new Date())

    setInterval(()=>setNow(new Date(),1000))
    var obj123 = {
        test: now.toLocaleTimeString,
    }

    return (
        <h1> 
            Время на данный момент {obj123.test}
        </h1>
    )
}
